import React, { useState } from 'react';
import './SignUp.css'; // You can reuse the same CSS file
import background from '../../assets/bg.svg';
import avatar from '../../assets/avatar.svg';
import wave from '../../assets/wave.png';
import { ToastContainer, toast } from 'react-toastify'; 
import 'react-toastify/dist/ReactToastify.css'; 
import { useNavigate } from 'react-router-dom'; 
import axios from 'axios'; 
import validateForm from '../Validation/SignInValidation'; // Create a separate validation file if needed

const SignIn = () => {
  const [values, setValues] = useState({
    email: '',
    password: '',
  });
  
  const [errors, setErrors] = useState({});
  const navigate = useNavigate(); 

  const handleChange = (e) => {
    setValues({
      ...values,
      [e.target.name]: e.target.value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    // Validate the form
    const validationErrors = validateForm(values);
    setErrors(validationErrors);

    // Check if there are no validation errors
    if (!validationErrors.email && !validationErrors.password) {
      try {
        const response = await axios.post('http://localhost:8087/signin', values);
        
        // Handle response
        if (response.data === "Success") {
          toast.success('Sign in successful!');
          navigate('/dashboard'); // Navigate to the desired page after successful sign-in
        } else {
          setErrors({ general: 'Invalid email or password.' }); // Set general error
        }
      } catch (error) {
        console.error('Error:', error);
        setErrors({ general: 'An error occurred. Please try again later.' }); // Handle error
      }
    }
  };

  return (
    <div>
      <img className="wave" src={wave} alt="wave" />
      <div className="container">
        <div className="img">
          <h1 className="title1">SIGN IN</h1>
          <img src={background} alt="background" />
        </div>
        <div className="login-content">
          <form onSubmit={handleSubmit}>
            <img src={avatar} alt="avatar" />
            <h2 className="title">Welcome Back</h2>

            {errors.general && <p className="error-message">{errors.general}</p>}

            <div className="input-div one">
              <div className="i">
                <i className="fas fa-envelope"></i>
              </div>
              <div className="div">
                <input 
                  type="email" 
                  className="input" 
                  placeholder='Email'
                  name="email"
                  value={values.email}
                  onChange={handleChange} 
                />
                {errors.email && <p className="error-message">{errors.email}</p>}
              </div>
            </div>

            <div className="input-div pass">
              <div className="i">
                <i className="fas fa-lock"></i>
              </div>
              <div className="div">
                <input 
                  type="password" 
                  className="input" 
                  placeholder='Password'
                  name="password"
                  value={values.password}
                  onChange={handleChange} 
                />
                {errors.password && <p className="error-message">{errors.password}</p>}
              </div>
            </div>

            <a href="#">Forgot Password?</a>
            <input type="submit" className="btn" value="Sign In" />
            <a href='/signup' className="abtn">SIGN UP</a>
            <p>Don't Have An Account?</p>
          </form>
        </div>
      </div>
    </div>
  );
};

export default SignIn;
